import React, { useState } from 'react';
import { GoogleMap, useLoadScript, Marker, InfoWindow } from '@react-google-maps/api';

const libraries = ["places"];
const mapContainerStyle = {
  width: '100%',
  height: '500px',
};
const center = {
  lat: 23.8103, // Default center (Dhaka, Bangladesh)
  lng: 90.4125,
};
const options = {
  disableDefaultUI: false,
  zoomControl: true,
};

const ItemList = ({ items }) => {
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: "AIzaSyBh15L6ZQVrZVsMjwAhb_3-X6bbgpSGtQk", // Replace with your actual API key
    libraries,
  });

  const [selectedLocation, setSelectedLocation] = useState(null);

  if (items.length === 0) {
    return <p>No locations found. Add some locations to get started!</p>;
  }

  if (loadError) return <div>Error loading maps</div>;
  if (!isLoaded) return <div>Loading Maps...</div>;

  // Calculate map center based on all locations
  const calculateCenter = () => {
    if (items.length === 0 || !items[0].location) return center;

    if (items.length === 1) {
      return {
        lat: items[0].location.lat,
        lng: items[0].location.lng
      };
    }

    // Calculate the average of all locations
    const sumLat = items.reduce((sum, item) => sum + (item.location ? item.location.lat : 0), 0);
    const sumLng = items.reduce((sum, item) => sum + (item.location ? item.location.lng : 0), 0);

    return {
      lat: sumLat / items.length,
      lng: sumLng / items.length
    };
  };

  return (
    <div>
      <h2>Saved Locations</h2>

      <GoogleMap
        mapContainerStyle={mapContainerStyle}
        zoom={10}
        center={calculateCenter()}
        options={options}
      >
        {items.map(item => {
          if (!item.location) return null;

          return (
            <Marker
              key={item._id}
              position={{
                lat: item.location.lat,
                lng: item.location.lng
              }}
              onClick={() => {
                setSelectedLocation(item);
              }}
            />
          );
        })}

        {selectedLocation && (
          <InfoWindow
            position={{
              lat: selectedLocation.location.lat,
              lng: selectedLocation.location.lng
            }}
            onCloseClick={() => {
              setSelectedLocation(null);
            }}
          >
            <div>
              <h3>{selectedLocation.name}</h3>
              <p>{selectedLocation.description}</p>
              <p>Added on: {new Date(selectedLocation.date).toLocaleDateString()}</p>
              <p>
                <strong>Coordinates:</strong> {selectedLocation.location.lat.toFixed(6)}, {selectedLocation.location.lng.toFixed(6)}
              </p>
            </div>
          </InfoWindow>
        )}
      </GoogleMap>

      <div className="location-list-container" style={{ marginTop: '20px' }}>
        <h3>Location List</h3>
        <ul className="item-list">
          {items.map(item => (
            <li key={item._id} className="item">
              <h3>{item.name}</h3>
              <p>{item.description}</p>
              {item.location && (
                <p>
                  <strong>Coordinates:</strong> {item.location.lat.toFixed(6)}, {item.location.lng.toFixed(6)}
                </p>
              )}
              <p>Added on: {new Date(item.date).toLocaleDateString()}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ItemList;
